import React from 'react';
import Logo from '../Logo';
import './styles.css';

const Footer = () => {
  return (
    <footer>
      <p>
        HomeBrew is a community driven Platform to Empower Home-makers and daily wage
        workers by providing them with ecommerce,
         logistics and an additional source of income.
      </p>
      <Logo />
    </footer>
  );
};

export default Footer;
